import "./App.css";
import Card from "./Card";
import Users from "/users.json";

export default function App() {
  return (
    <div className="grid grid-cols-3 md:grid-cols-1 lg:grid-cols-3 gap-6">
      {Users.map((user, index) => (
        <Card userData={user} key={index} />
      ))}
    </div>
  );
}
